import React from 'react';
import Cell from './Cell';
import './Board.css';

const Board = () => {
  const cells = Array.from({ length: 19 });

  return (
    <div className="board">
      {cells.map((_, index) => (
        <Cell key={index} />
      ))}
    </div>
  );
};

export default Board;
